// }

let c1 = 'item';
let c2 = 'active';

let classes = c1 + ' ' + c2
let classecActive = `${c1} ${c2}`






export const NavBar = () => {
   return  <nav className={classes.nav}>
       <div className={`${c1} ${c2}`}>
           <a>Profile</a>
       </div>
       <div className={classes.item}>
           <a>Messages</a>
       </div>
       <div className={classes.item}>
           <a>News</a>
       </div>
       <div className={classes.item}>
           <a>Music</a>
       </div>
       <div className={classes.item}>
           <a>Settings</a>
       </div>
   </nav>
}
